INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 100211, "そうなんです、胸が苦しくて\n仕方ないんです……\nや、やっぱり重病なんでしょうか……", 4, 1007402, 0, 0, 1007402036);
