INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 111011, "もののついでの挨拶さ。\nフィールドワークに訪れた旅先で、\n隻眼の名医がいると聞いたものでな。\nミツキ師に違いないと察したよ。", 5, 1007404, 0, 0, 1007404038);
