INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 117531, "ふふ、相変わらず敏い子ね。\nそういうところ、家系なのかしら。\nああ、そういえば偏屈ジジイ……\nこほん、ユニークなお爺様たちは元気？", 5, 1007404, 0, 0, 1007404043);
