INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (0, "", "", 21, "vo_mhp_1007404", "vo_mhp_1008", 0, 1007404, "", "", 1007404059);
INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 111011, "その節は身内が申し訳ない。\n彼らは都の有識者──ことに理系の者を\n蛇蝎のごとく敵視しているのだ。", 5, 1007404, 0, 0, 1007404060);
INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES ("", "", "", 91, 0, 0, "", 1007404, "", "", 1007404061);
