INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (0, "", "", 21, "vo_mhp_1007404", "vo_mhp_1009", 0, 1007404, "", "", 1007404063);
INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 111011, "やれやれ、嘆かわしい老人たちめ。\n学問に貴賤なし──\nぼくらはみな等しく学びの信徒だ、\n文系だ理系だと諍うことの愚かしさよ。", 4, 1007404, 0, 0, 1007404064);
INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES ("", "", "", 91, 0, 0, "", 1007404, "", "", 1007404065);
