INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (0, "", "", 21, "vo_mhp_1007404", "vo_mhp_1010", 0, 1007404, "", "", 1007404068);
INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (1, 0, 0.5, 11, 117531, "そうね、うん、ところでユニちゃん。\nちょっと込み入ったことを聞くけれど、\n里からの仕送りは足りてるのかしら。", 6, 1007404, 0, 0, 1007404069);
